import useFetch from "../../hooks/userFetch";
import "./featured.css";
import { useNavigate } from "react-router-dom";
import { useContext, useState } from "react";
import { SearchContext } from "../../context/SearchContext";

const Featured = () => {
  const { data, loading, error } = useFetch(
    "/event/countByCity?cities=jaipur,mumbai,delhi,pune"
  );

  const [festName, setFestName] = useState("");
  const [cityName, setCityName] = useState("");
  const [collegeName, setCollegeName] = useState("");
  const navigate = useNavigate();
  const { dispatch } = useContext(SearchContext);
  const handleClick = (event) => {
    const cityName = event.target
      .closest(".card-flyer")
      .querySelector(".text-container h6").textContent;
    setCityName(cityName);
    handleSearch();
  };
  const handleSearch = () => {
    dispatch({
      type: "NEW_SEARCH",
      payload: { festName, cityName, collegeName },
    });
    navigate("/events", { state: { festName, collegeName, cityName } });
  };

  return (
    <div>
      {loading ? (
        "loading..."
      ) : (
        <>
          <div id="cards_landscape_wrap-2">
            <div className="container">
              <div className="row">
                <div
                  className="col-xs-12 col-sm-6 col-md-3 col-lg-3"
                  onClick={handleSearch}
                >
                  <a href="">
                    <div className="card-flyer">
                      <div className="text-box">
                        <div className="image-box">
                          <img
                            src="https://cdn.pixabay.com/photo/2018/03/30/15/11/deer-3275594_960_720.jpg"
                            alt=""
                          />
                        </div>
                        <div className="text-container">
                          <h6>Jaipur</h6>
                          <p>{data[2]} College Fests</p>
                        </div>
                      </div>
                    </div>
                  </a>
                </div>
                <div className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                  <a href="">
                    <div className="card-flyer">
                      <div className="text-box">
                        <div className="image-box">
                          <img
                            src="https://cdn.pixabay.com/photo/2018/04/09/19/55/low-poly-3305284_960_720.jpg"
                            alt=""
                          />
                        </div>
                        <div className="text-container">
                          <h6>Mumbai</h6>
                          <p>{data[2]} College Fests</p>
                        </div>
                      </div>
                    </div>
                  </a>
                </div>
                <div className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                  <a href="">
                    <div className="card-flyer">
                      <div className="text-box">
                        <div className="image-box">
                          <img
                            src="https://cdn.pixabay.com/photo/2018/04/06/13/46/poly-3295856_960_720.png"
                            alt=""
                          />
                        </div>

                        <div className="text-container">
                          <h6>Delhi</h6>
                          <p>{data[2]} College Fests</p>
                        </div>
                      </div>
                    </div>
                  </a>
                </div>
                <div className="col-xs-12 col-sm-6 col-md-3 col-lg-3">
                  <a href="">
                    <div className="card-flyer">
                      <div className="text-box">
                        <div className="image-box">
                          <img
                            src="https://cdn.pixabay.com/photo/2018/03/30/15/12/dog-3275593_960_720.jpg"
                            alt=""
                          />
                        </div>
                        <div className="text-container">
                          <h6>Pune</h6>
                          <p>{data[2]} College Fests</p>
                        </div>
                      </div>
                    </div>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default Featured;
